// frontend/src/components/Footer.js
import React from 'react';

const Footer = () => {
  return (
    <footer>
      <a href="#contact">Contact Us</a> | 
      <a href="#privacy">Privacy Policy</a> | 
      <a href="#terms">Terms of Service</a>
    </footer>
  );
};

export default Footer;
